pub enum Coordinates<'a, C: Curve> {
    Identity,
    Compact {
            x: &'a FieldBytes<C>,
        },
    Compressed {
            x: &'a FieldBytes<C>,
            y_is_odd: bool,
        },
    Uncompressed {
            x: &'a FieldBytes<C>,
            y: &'a FieldBytes<C>,
        },
}
